import React,{useState,useEffect} from "react"
import axios from "axios"
import Navbar from "./Navbar"
import "./pageManager.css"
function Manager(){
    const [posts,setPosts] =useState([])

    useEffect(()=> {
        axios.get("http://localhost:9002/admin")
        .then(res=>{
            console.log(res)
            setPosts(res.data)
        })
        .catch(err=>{
            console.log(err)
        })
    },[])
    return(
        <div>
            <Navbar/>
            <div className="bc-img">
                {posts.map(post=>(
                    
                    <ol>
                    <br></br>
                    <li key={post._id}>{post.name}</li>
                    <li key={post._id}>{post.email}</li>
                    <li key={post._id}>{post.query}</li>
                    <a href = "mailto: {post.email}">Solve query of {post.name}</a>
                    </ol>

                ))}
            </div>
        </div>
    )
}

export default Manager;
